import React, { useState } from 'react';

const Form = () => {

    const [data, setData] = useState({name:"",age:""});
    return (
        <div>
            <input type="text" value={data.name} onChange={(event)=>setData({...data, name : event.target.value})}/>
            <br/><br/>
            <p>{JSON.stringify(data)}</p>
        </div>
    );
};

export default Form;
